import React, { useEffect, useState } from "react";

const TableComponent = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("http://10.1.37.114:5000/getRules", {
      method: "POST",
    })
      .then((response) => response.json())
      .then((responseData) => {
        setData(responseData.data);
      })
      .catch((error) => {
        console.error("Error fetching data:", error);
      });
  }, []);

  return (
    <div>
      <table>
        <thead>
          <tr>
            <th></th>
            <th>Model Name</th>
            <th>Rule Creation Date</th>
            <th>Rule Name</th>
            <th>Rule Description</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item, index) => (
            <tr key={index}>
              <td>
                <input type="checkbox" />
              </td>
              <td>{item["Model Name"]}</td>
              <td>{item["Rule Creation Date"]}</td>
              <td>{item["Rule Name"]}</td>
              <td>
                <ul>
                  {item["Rule Description"].map((rule, index) => (
                    <li key={index}>{rule.label}</li>
                  ))}
                </ul>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      <button>Deploy</button>
    </div>
  );
};

export default TableComponent;
